(defn parse-line [s]
  (->> (str/split s #"\s+")
    (remove str/blank?)
    (mapv edn/read-string)))

(defn parse-input [s]
  (->> s str/split-lines (map parse-line)))


(defn triangle? [[a b c]]
  (and
    (< a (+ b c))
    (< b (+ a c))
    (< c (+ a b))))

(defn f1 [input]
  (->> input (parse-input) (filter triangle?) (count)))


(defn f2 [input]
  (->> input
    (parse-input)
    (partition 3)
    (mapcat (partial apply map vector))
    (filter triangle?)
    (count)))

(assert (= (f1 input) 917))
(assert (= (f2 input) 1649))
